import React, { useEffect, useState } from 'react';

const RosterPaymentsPage = () => {
  const [roster, setRoster] = useState([]);

  useEffect(() => {
    fetch('/data/roster.json')
      .then(res => res.json())
      .then(data => setRoster(data))
      .catch(err => {
        console.error('Error loading roster:', err);
        setRoster([]);
      });
  }, []);

  const getPaymentStatus = (balance) => {
    const amount = parseFloat(balance);
    if (isNaN(amount) || amount === 0) return 'No Payment';
    if (amount > 0 && amount < 150) return 'Partial Payment';
    return 'Paid in Full';
  };

  return (
    <div className="p-4 max-w-2xl mx-auto">
      <h2 className="text-xl font-bold mb-4">Player Roster & Payments</h2>
      <div className="bg-white shadow rounded-lg overflow-hidden">
        <table className="min-w-full text-sm text-left">
          <thead className="bg-gray-200 text-gray-700">
            <tr>
              <th className="px-4 py-2">Game Name</th>
              <th className="px-4 py-2">Payment Status</th>
            </tr>
          </thead>
          <tbody>
            {roster.map((player, idx) => (
              <tr key={idx} className="border-t">
                <td className="px-4 py-2 font-medium">{player.GameName}</td>
                <td className="px-4 py-2">
                  {getPaymentStatus(player.Balance)}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default RosterPaymentsPage;
